import React from 'react'
import './Programs.css'
const Programs = () => {
  return (
    <div className="Programs" id='programs'>
        {/* headers */}
        <div className="programs-header">
            <span>Explore out</span>
            <span>Programs</span>
            <span>to shape your</span>
        </div>
    </div>
  );
};

export default Programs
